何に使おうかな～<br>
そのまま切ってスニーカーに通せば完成!<br>
市販の紐靴専用使えば更に綺麗に仕上がります<br>
巾着の紐や他に結構色々使えて便利です(^_-)-☆<br>
ネオンカラーがお洒落です♪<br>
2メートルカット販売です

